    [],nt"num_tags": 5,nt"name": "red-rock-lakes-national-wildlife-refuge-annual-narrative-report-calendar-year-1983",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Red Rock
    Lakes NWR outlines Refuge accomplishments during the 1983 calendar year. The report
    begins with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses management planning,
    public participation, and research and investigations. Refuge administration is
    outlined; information about personnel, volunteer programs, funding, safety, and
    technical assistance is given. Habitat management is also covered; subjects include
    wetlands, grasslands, and grazing. The wildlife section of the report discusses
    endangered and threatened species, waterfowl, marsh birds and waterbirds, raptors,
    game mammals, fisheries resources, animal control, and marking and bird banding.
    The public uses of the Refuge described in this report include interpretive programs,
    hunting, fishing, wildlife observation, outdoor recreation, and law enforcement.
    The equipment and facilities section of the report provides information about rehabilitation,
    major maintenance, equipment replacement, and energy conservation. Cooperative programs
    and items of interest are provided at the end. Field guides are attached.",nt"owner_org":
